import{_ as e,c as o,o as r,a as t}from"./app.5a09cad8.js";const u=JSON.parse('{"title":"Awesome Low Code","description":"","frontmatter":{},"headers":[{"level":2,"title":"Contents","slug":"contents","link":"#contents","children":[]},{"level":2,"title":"Platforms","slug":"platforms","link":"#platforms","children":[{"level":3,"title":"Citizen Automation and Development Platform","slug":"citizen-automation-and-development-platform","link":"#citizen-automation-and-development-platform","children":[]},{"level":3,"title":"Low Code Application Platform","slug":"low-code-application-platform","link":"#low-code-application-platform","children":[]},{"level":3,"title":"Business Process Management","slug":"business-process-management","link":"#business-process-management","children":[]},{"level":3,"title":"Robotic Process Automation","slug":"robotic-process-automation","link":"#robotic-process-automation","children":[]},{"level":3,"title":"Intelligent Virtual Agent","slug":"intelligent-virtual-agent","link":"#intelligent-virtual-agent","children":[]},{"level":3,"title":"Integration Platform as a Service","slug":"integration-platform-as-a-service","link":"#integration-platform-as-a-service","children":[]},{"level":3,"title":"Low Code API Management Platform","slug":"low-code-api-management-platform","link":"#low-code-api-management-platform","children":[]}]},{"level":2,"title":"Tools, Extensions and Frameworks","slug":"tools-extensions-and-frameworks","link":"#tools-extensions-and-frameworks","children":[{"level":3,"title":"Power Platform (Microsoft)","slug":"power-platform-microsoft","link":"#power-platform-microsoft","children":[]}]},{"level":2,"title":"Reference Resources","slug":"reference-resources","link":"#reference-resources","children":[{"level":3,"title":"Power Platform (Microsoft)","slug":"power-platform-microsoft-1","link":"#power-platform-microsoft-1","children":[]},{"level":3,"title":"Workato","slug":"workato","link":"#workato","children":[]}]},{"level":2,"title":"Learning Resources","slug":"learning-resources","link":"#learning-resources","children":[{"level":3,"title":"Power Platform (Microsoft)","slug":"power-platform-microsoft-2","link":"#power-platform-microsoft-2","children":[]},{"level":3,"title":"Workato","slug":"workato-1","link":"#workato-1","children":[]}]},{"level":2,"title":"Samples, Templates and Solutions","slug":"samples-templates-and-solutions","link":"#samples-templates-and-solutions","children":[{"level":3,"title":"Power Platform (Microsoft)","slug":"power-platform-microsoft-3","link":"#power-platform-microsoft-3","children":[]},{"level":3,"title":"Workato","slug":"workato-2","link":"#workato-2","children":[]}]},{"level":2,"title":"Community","slug":"community","link":"#community","children":[{"level":3,"title":"Power Platform (Microsoft)","slug":"power-platform-microsoft-4","link":"#power-platform-microsoft-4","children":[]},{"level":3,"title":"Workato","slug":"workato-3","link":"#workato-3","children":[]}]},{"level":2,"title":"Blogs","slug":"blogs","link":"#blogs","children":[{"level":3,"title":"Power Platform (Microsoft)","slug":"power-platform-microsoft-5","link":"#power-platform-microsoft-5","children":[]},{"level":3,"title":"Workato","slug":"workato-4","link":"#workato-4","children":[]}]},{"level":2,"title":"Other Lists","slug":"other-lists","link":"#other-lists","children":[{"level":3,"title":"Power Platform (Microsoft)","slug":"power-platform-microsoft-6","link":"#power-platform-microsoft-6","children":[]}]}],"relativePath":"no-codes/low-code-3.md"}'),a={name:"no-codes/low-code-3.md"},i=t('<h1 id="awesome-low-code" tabindex="-1">Awesome Low Code <a href="https://awesome.re" target="_blank" rel="noreferrer"><img src="https://awesome.re/badge.svg" alt="Awesome"></a> <a class="header-anchor" href="#awesome-low-code" aria-hidden="true">#</a></h1><blockquote><p>A curated list of Awesome Low Code platforms, vendors, tools and resources.</p></blockquote><blockquote><p>Low Code platforms provide a development and runtime environment used to create all kinds of software application through an intuitive experience, with minimal to no coding skills requires.</p></blockquote><h2 id="contents" tabindex="-1">Contents <a class="header-anchor" href="#contents" aria-hidden="true">#</a></h2><ul><li><a href="#awesome-low-code-">Awesome Low Code </a><ul><li><a href="#contents">Contents</a></li><li><a href="#platforms">Platforms</a><ul><li><a href="#citizen-automation-and-development-platform">Citizen Automation and Development Platform</a></li><li><a href="#low-code-application-platform">Low Code Application Platform</a></li><li><a href="#business-process-management">Business Process Management</a></li><li><a href="#robotic-process-automation">Robotic Process Automation</a></li><li><a href="#intelligent-virtual-agent">Intelligent Virtual Agent</a></li><li><a href="#integration-platform-as-a-service">Integration Platform as a Service</a></li><li><a href="#low-code-api-management-platform">Low Code API Management Platform</a></li></ul></li><li><a href="#tools-extensions-and-frameworks">Tools, Extensions and Frameworks</a><ul><li><a href="#power-platform-microsoft">Power Platform (Microsoft)</a></li></ul></li><li><a href="#reference-resources">Reference Resources</a><ul><li><a href="#power-platform-microsoft-1">Power Platform (Microsoft)</a></li><li><a href="#workato">Workato</a></li></ul></li><li><a href="#learning-resources">Learning Resources</a><ul><li><a href="#power-platform-microsoft-2">Power Platform (Microsoft)</a></li><li><a href="#workato-1">Workato</a></li></ul></li><li><a href="#samples-templates-and-solutions">Samples, Templates and Solutions</a><ul><li><a href="#power-platform-microsoft-3">Power Platform (Microsoft)</a></li><li><a href="#workato-2">Workato</a></li></ul></li><li><a href="#community">Community</a><ul><li><a href="#power-platform-microsoft-4">Power Platform (Microsoft)</a></li><li><a href="#workato-3">Workato</a></li></ul></li><li><a href="#blogs">Blogs</a><ul><li><a href="#power-platform-microsoft-5">Power Platform (Microsoft)</a></li><li><a href="#workato-4">Workato</a></li></ul></li><li><a href="#other-lists">Other Lists</a><ul><li><a href="#power-platform-microsoft-6">Power Platform (Microsoft)</a></li></ul></li></ul></li></ul><h2 id="platforms" tabindex="-1">Platforms <a class="header-anchor" href="#platforms" aria-hidden="true">#</a></h2><h3 id="citizen-automation-and-development-platform" tabindex="-1">Citizen Automation and Development Platform <a class="header-anchor" href="#citizen-automation-and-development-platform" aria-hidden="true">#</a></h3><p>A development platform for business users (citizen developer is a term for business users, not a role or a job title) that doesn&#39;t require coding skills and is based on intuitive drag &amp; drop interfaces. Applications created in such platforms are usually made to automate or improve efficiency of business processes and of personal productivity, without going through IT. CADP are usually consumed as SaaS.</p><ul><li><a href="https://flow.microsoft.com/" target="_blank" rel="noreferrer">Power Automate (Microsoft)</a> - An online workflow service that automates actions across the most common apps and services.</li><li><a href="https://zapier.com/" target="_blank" rel="noreferrer">Zapier</a> - Allows its users to easily connect and automate the apps they use.</li><li><a href="https://www.salesforce.com/products/platform/einstein-automate/" target="_blank" rel="noreferrer">Einstein Automate (Salesforce)</a> - Empower your employees to do more of what matters by automating business processes easily without needing specialized development skills.</li><li><a href="https://www.atlassian.com/software/jira/features/automation" target="_blank" rel="noreferrer">Jira Automation (Atlassian)</a> - Automation is a No Code rule builder that enables customers to build if-this-then-that-rules based on events in Jira.</li><li><a href="https://trello.com/power-ups/category/automation" target="_blank" rel="noreferrer">Trello Power-Ups (Atlassian)</a> - Helps teams meet their unique business needs through adaptable features and integrations.</li><li><a href="https://www.zoho.com/flow/" target="_blank" rel="noreferrer">Flow (Zoho)</a> - An integration platform that helps you connect your apps without any code.</li></ul><h3 id="low-code-application-platform" tabindex="-1">Low Code Application Platform <a class="header-anchor" href="#low-code-application-platform" aria-hidden="true">#</a></h3><p>An advanced development platform that enable organizations to create powerful enterprise grade applications with no to minimum extra coding requirements with easy to use drag &amp; drop interfaces. Since such platforms simplify the application development process, more types of personas can contribute and accelerate the development process. Those platforms are PaaS development platforms, and can also reduce development cost and maintenance.</p><ul><li><a href="https://powerapps.com/" target="_blank" rel="noreferrer">Power Apps (Microsoft)</a> - Build apps in hours—not months—that easily connect to data, use Excel-like expressions to add logic, and run on the web, iOS, and Android devices.</li><li><a href="https://powerbi.microsoft.com/" target="_blank" rel="noreferrer">Power BI</a> - Unify data from many sources to create interactive, immersive dashboards and reports that provide actionable insights and drive business results.</li><li><a href="https://appian.com/" target="_blank" rel="noreferrer">Appian</a> - Provides a Low Code software development platform that enables organizations to rapidly develop powerful applications.</li><li><a href="https://mendix.com/" target="_blank" rel="noreferrer">Mendix</a> - The fastest and easiest high-productivity platform to create and continuously improve multi-channel applications at scale.</li><li><a href="https://www.outsystems.com/" target="_blank" rel="noreferrer">OutSystems</a> - A Low Code platform that enables businesses to develop, deploy, and manage enterprise-grade apps.</li><li><a href="https://www.servicenow.com/now-platform.html" target="_blank" rel="noreferrer">Now Platform (ServiceNow)</a> - Drive connected digital workflows across the enterprise, deliver modern, consumer-like experiences, and accelerate time-to-value and innovation.</li><li><a href="https://www.zoho.com/creator/low-code-platform/" target="_blank" rel="noreferrer">Creator (Zoho)</a> - Build applications from scratch without having to write endless lines of code.</li><li><a href="https://www.bettyblocks.com/" target="_blank" rel="noreferrer">BettyBlocks</a> - The #1 No Code platform for innovation, agility and empowerment. Used to create mobile, business and web applications at lightning speed.</li><li><a href="https://apex.oracle.com/en/platform/low-code/" target="_blank" rel="noreferrer">APEX (Oracle)</a> - A Low Code development platform that enables you to build scalable, secure enterprise apps, with world-class features, that can be deployed anywhere.</li><li><a href="https://www.salesforce.com/products/platform" target="_blank" rel="noreferrer">Salesforce Platform, prev. Force.com (Salesforce)</a> - Click, create, and ship from anywhere with Low Code.</li><li><a href="https://n8n.io/" target="_blank" rel="noreferrer">n8n</a> - Workflow automation tool with many integrations and with fair-code license.</li></ul><h3 id="business-process-management" tabindex="-1">Business Process Management <a class="header-anchor" href="#business-process-management" aria-hidden="true">#</a></h3><p>A Low Code Application Platform dedicated to streamlining business processes. These platforms enable business users to automate complicated business workflows and actions with no coding background by providing an easy to use drag &amp; drop interface. Automations that are built in such platforms are usually built in an event-driven mode (triggers) around critical business processes. BPA can be consumed via a SaaS or an on-premises appliance.</p><ul><li><a href="https://www.pega.com/" target="_blank" rel="noreferrer">PegaSystems</a> - Provides business process and customer relationship management solutions for organizations.</li><li><a href="https://agilepoint.com/" target="_blank" rel="noreferrer">AgilePoint</a> - Deploy business-changing ideas in minutes, not months, with the AgilePoint digital process automation platform.</li><li><a href="https://www.quickbase.com/" target="_blank" rel="noreferrer">QuickBase</a> - Helps businesses quickly turn ideas about better ways to work into apps that make them more efficient, informed, and productive.</li><li><a href="https://www.creatio.com/" target="_blank" rel="noreferrer">Creatio</a> - A global software company providing a leading Low Code platform for process management and CRM.</li><li><a href="https://www.auraquantic.com/" target="_blank" rel="noreferrer">AuraQuantic</a> - A digital platform designed for business users to easily and rapidly build unlimited processes and applications.</li><li><a href="https://www.kintone.com/" target="_blank" rel="noreferrer">Kintone</a> - The best productivity software to business transformation Platform.</li><li><a href="https://www.prontoforms.com/" target="_blank" rel="noreferrer">ProntoForms</a> - Provides mobile business solutions to automate field sales, field service, and field data collection.</li><li><a href="https://trackvia.com/" target="_blank" rel="noreferrer">TrackVia</a> - The leading Low Code workflow platform for operations.</li><li><a href="https://newgensoft.com/" target="_blank" rel="noreferrer">NewGen</a> - Simplify your complex, content-driven business needs with one comprehensive Low Code platform.</li></ul><h3 id="robotic-process-automation" tabindex="-1">Robotic Process Automation <a class="header-anchor" href="#robotic-process-automation" aria-hidden="true">#</a></h3><p>An automation platform that helps organizations remove human manual intensive processes and avoid errors, as well as making sure human required attention is efficiently maximized only on critical aspects of work. RPA technology introduced the concept of software robots, built by the end-user humans, to perform repetitive manual intensive processes in an automation fashion, and can understand and processes computer interactions with SaaS and on-premises applications just like a human-being. RPA technologies involve building, deploying, and managing those software robots.</p><ul><li><a href="https://powerautomate.microsoft.com/en-us/robotic-process-automation/" target="_blank" rel="noreferrer">Power Automate Desktop (Microsoft)</a> - Automate everything from simple data transfers to complex business workflows—directly from your desktop—using RPA desktop flows in Power Automate Desktop.</li><li><a href="https://www.servicetrace.com/" target="_blank" rel="noreferrer">Servicetrace RPA (Salesforce)</a> - Develop innovation in robotic solutions.</li><li><a href="https://appian.com/platform/complete-automation/robotic-process-automation-rpa.html" target="_blank" rel="noreferrer">Appian RPA</a> - Orchestrate RPA bots with people, systems, and data in a single workflow, scaling automation across your entire organization.</li><li><a href="https://www.workato.com/modern-rpa" target="_blank" rel="noreferrer">Workato RPA</a> - Integration-powered RPA for Intelligent Automation.</li></ul><h3 id="intelligent-virtual-agent" tabindex="-1">Intelligent Virtual Agent <a class="header-anchor" href="#intelligent-virtual-agent" aria-hidden="true">#</a></h3><p>A software application which is built and configured by its users to perform manual repetitive and error-prone tasks in an automated faster fashion. Bots are built and configured mostly in Low Code platforms via easy to use drag &amp; drop interfaces. Examples to the use of bots could be seen in user conversation via messaging and voice platforms that help them take decisions and act through business processes.</p><ul><li><a href="https://powervirtualagents.microsoft.com/" target="_blank" rel="noreferrer">Power Virtual Agents (Microsoft)</a> - Lets you create powerful chatbots that can answer questions posed by your customers, other employees, or visitors to your website or service.</li><li><a href="https://docs.workato.com/workbot/overview.html" target="_blank" rel="noreferrer">Workato Workbot</a> - A bot platform that allows you to build customizable workflows.</li></ul><h3 id="integration-platform-as-a-service" tabindex="-1">Integration Platform as a Service <a class="header-anchor" href="#integration-platform-as-a-service" aria-hidden="true">#</a></h3><p>A platform that help organizations control, simplify and standardize the way that applications are integrated (internally developed or 3rd party SaaS). Such platforms help to share data between applications, automate business workflows and remove manual error prone ones, in an advanced controlled manner. iPaaS also enables more types of personas to integrate applications, removing the constant dependency on software developers. iPaaS can be deployed within an organization either as a SaaS or as on-premises appliance.</p><ul><li><a href="https://azure.microsoft.com/en-us/services/logic-apps/" target="_blank" rel="noreferrer">Azure Logic Apps (Microsoft)</a> - A cloud-based platform for creating and running automated workflows that integrate your apps, data, services, and systems.</li><li><a href="https://mulesoft.com/" target="_blank" rel="noreferrer">MuleSoft (Salesforce)</a> - Provides an integration and API platform that makes it easy to connect data from any system to create connected experiences.</li><li><a href="https://www.workato.com" target="_blank" rel="noreferrer">Workato</a> - An enterprise automation platform that helps organizations work faster and smarter without compromising governance and security.</li></ul><h3 id="low-code-api-management-platform" tabindex="-1">Low Code API Management Platform <a class="header-anchor" href="#low-code-api-management-platform" aria-hidden="true">#</a></h3><p>A Low Code platform which supports full lifecycle API management, including creation, management and monitoring of API endpoints.</p><ul><li><a href="https://www.mulesoft.com/platform/api-management" target="_blank" rel="noreferrer">MuleSoft</a> - Manage your API lifecycle, quickly design, test, and publish APIs.</li><li><a href="https://docs.workato.com/api-management.html" target="_blank" rel="noreferrer">Workato API Management</a> - Turn callable recipes into endpoints and organize the endpoints into API collections, making it easier for users to find and consume the endpoints through other recipes or third-party apps, without requiring access to your Workato account.</li></ul><h2 id="tools-extensions-and-frameworks" tabindex="-1">Tools, Extensions and Frameworks <a class="header-anchor" href="#tools-extensions-and-frameworks" aria-hidden="true">#</a></h2><h3 id="power-platform-microsoft" tabindex="-1">Power Platform (Microsoft) <a class="header-anchor" href="#power-platform-microsoft" aria-hidden="true">#</a></h3><ul><li><a href="https://github.com/MscrmTools/XrmToolBox" target="_blank" rel="noreferrer">XrmToolBox</a> - An application that gather multiple tools to ease the customization and configuration of Microsoft Dynamics CRM/365/Dataverse/PowerApps.</li><li><a href="https://github.com/rajyraman/Levelup-for-Dynamics-CRM" target="_blank" rel="noreferrer">Levelup for Dynamics CRM</a> - Chrome, Edge Chromium and Firefox Extension for Dynamics CRM/365/Power Apps Power users.</li><li><a href="https://github.com/PowerPlatformAF/PowerPlatformAF" target="_blank" rel="noreferrer">Power Platform Adoption Framework</a> - The framework that enables people to create beautiful and useful things on Power Platform deployed in large, enterprise-grade organizations.</li><li><a href="https://github.com/Zerg00s/FlowPowerAppsMigrator" target="_blank" rel="noreferrer">Flow &amp; Power Apps Migrator</a> - Converts SharePoint Data sources for the MS Flow and PowerApps to a new tenant of your choice.</li><li><a href="https://github.com/TracyGH/SharePointWorkflowConverter" target="_blank" rel="noreferrer">SharePoint Workflow Converter</a> - A proof-of-concept C# console application for retrieving legacy 2010 &amp; 2013 custom SharePoint workflow definition files, and creating new Power Automate flows programmatically.</li></ul><h2 id="reference-resources" tabindex="-1">Reference Resources <a class="header-anchor" href="#reference-resources" aria-hidden="true">#</a></h2><h3 id="power-platform-microsoft-1" tabindex="-1">Power Platform (Microsoft) <a class="header-anchor" href="#power-platform-microsoft-1" aria-hidden="true">#</a></h3><ul><li><a href="https://github.com/microsoft/PowerPlatformConnectors" target="_blank" rel="noreferrer">Power Platform Connectors</a> - This is a repository for Microsoft Power Automate, Power Apps, and Azure Logic Apps connectors.</li><li><a href="https://github.com/microsoft/Power-Fx" target="_blank" rel="noreferrer">Microsoft Power Fx</a> - Power Fx Low Code programming language.</li></ul><h3 id="workato" tabindex="-1">Workato <a class="header-anchor" href="#workato" aria-hidden="true">#</a></h3><ul><li><a href="https://github.com/workato/custom_connector_docs" target="_blank" rel="noreferrer">Custom Connector Docs</a> - Source files for Workato custom connector documentation.</li></ul><h2 id="learning-resources" tabindex="-1">Learning Resources <a class="header-anchor" href="#learning-resources" aria-hidden="true">#</a></h2><h3 id="power-platform-microsoft-2" tabindex="-1">Power Platform (Microsoft) <a class="header-anchor" href="#power-platform-microsoft-2" aria-hidden="true">#</a></h3><ul><li><a href="https://github.com/pnp/powerfx-samples" target="_blank" rel="noreferrer">Power Fx Samples</a> - This repository contains samples for Power Fx Low Code programming language.</li><li><a href="https://github.com/microsoft/PowerApps-Azure-Lab" target="_blank" rel="noreferrer">Power Apps &amp; Azure Lab</a> - Repository to host the PowerApps Azure Lab.</li><li><a href="https://github.com/MicrosoftLearning/PL-900-Microsoft-Power-Platform-Fundamentals" target="_blank" rel="noreferrer">PL-900: Power Platform Fundamentals</a> - Power Platform Fundamentals course materials.</li></ul><h3 id="workato-1" tabindex="-1">Workato <a class="header-anchor" href="#workato-1" aria-hidden="true">#</a></h3><ul><li><a href="https://github.com/workato/full-embed-sample" target="_blank" rel="noreferrer">Embedding Guide</a> - A guided example on how to use Workato embedded.</li></ul><h2 id="samples-templates-and-solutions" tabindex="-1">Samples, Templates and Solutions <a class="header-anchor" href="#samples-templates-and-solutions" aria-hidden="true">#</a></h2><h3 id="power-platform-microsoft-3" tabindex="-1">Power Platform (Microsoft) <a class="header-anchor" href="#power-platform-microsoft-3" aria-hidden="true">#</a></h3><ul><li><a href="https://github.com/pnp/powerapps-samples" target="_blank" rel="noreferrer">Power Apps Samples</a> - Contains curated community Microsoft Power App samples.</li><li><a href="https://github.com/Eickhel/PowerApps-samples" target="_blank" rel="noreferrer">PowerApps Samples</a> - Power Apps samples by Power Nimbus.</li><li><a href="https://github.com/iAmManCat/PowerApps-Branding-Template" target="_blank" rel="noreferrer">Power Apps Branding Template</a> - A template to empower developers and reduce time wasted on control changes.</li><li><a href="https://github.com/pnp/sp-power-platform-solutions" target="_blank" rel="noreferrer">SharePoint Power Platform Solutions</a> - Sample PowerApps solutions designed to be used in SharePoint context.</li><li><a href="https://github.com/pnp/powerautomate-samples" target="_blank" rel="noreferrer">Power Automate Samples</a> - Contains curated community samples for Microsoft Power Automate.</li><li><a href="https://github.com/wortell/PowerAutomate-AutomatischeReistijd" target="_blank" rel="noreferrer">Automatic travel time</a> - Automatic travel time in your Office 365 calendar.</li><li><a href="https://github.com/ericsche/MCinTeams" target="_blank" rel="noreferrer">Message Center in Teams</a> - Message Center in Teams is a simple PowerAutomate Solution to gather Message Center Announcement and post them in a Teams Channel.</li><li><a href="https://github.com/ferrybouwman/Power-BI-Read-Only-REST-API" target="_blank" rel="noreferrer">Consume Power BI</a> - Solution based on either Powershell or Power Automate (Flow) to consume the recently released Power BI Asynchronous Unified Scanning API.</li><li><a href="https://github.com/vaibhav21791/PostListItemToTwitter" target="_blank" rel="noreferrer">Post List Item To Twitter</a> - A Microsoft Power Automate Flow to Post a SharePoint List Item to Twitter along with media content.</li></ul><h3 id="workato-2" tabindex="-1">Workato <a class="header-anchor" href="#workato-2" aria-hidden="true">#</a></h3><ul><li><a href="https://www.workato.com/solutions" target="_blank" rel="noreferrer">Solution Marketplace</a> - A curated list of ready-to-use solutions built by Workato and vendors.</li><li><a href="https://support.workato.com/en/support/solutions" target="_blank" rel="noreferrer">Support History</a> - A public repository of resolved support tickets to help tackle issues.</li></ul><h2 id="community" tabindex="-1">Community <a class="header-anchor" href="#community" aria-hidden="true">#</a></h2><h3 id="power-platform-microsoft-4" tabindex="-1">Power Platform (Microsoft) <a class="header-anchor" href="#power-platform-microsoft-4" aria-hidden="true">#</a></h3><ul><li><a href="https://powerusers.microsoft.com/t5/Power-Apps-Community/ct-p/PowerApps1" target="_blank" rel="noreferrer">Microsoft Power Apps Official Community</a></li><li><a href="https://powerusers.microsoft.com/t5/Microsoft-Power-Automate/ct-p/MPACommunity" target="_blank" rel="noreferrer">Microsoft Power Automate Official Community</a></li><li><a href="https://powerusers.microsoft.com/t5/Power-Virtual-Agents-Community/ct-p/PVACommunity" target="_blank" rel="noreferrer">Microsoft Power Virtual Agents Official Community</a></li><li><a href="https://community.powerbi.com/" target="_blank" rel="noreferrer">Microsoft Power BI Official Community</a></li><li><a href="https://powp.co/" target="_blank" rel="noreferrer">PowP.Co Discord Community</a> - A Discord community of Power Platform enthusiasts.</li></ul><h3 id="workato-3" tabindex="-1">Workato <a class="header-anchor" href="#workato-3" aria-hidden="true">#</a></h3><ul><li><a href="https://community.workato.com/" target="_blank" rel="noreferrer">Workato Communities</a> - The official Workato communities website.</li><li><a href="https://systematic.workato.com/" target="_blank" rel="noreferrer">Systematic</a> - The only community for business systems.</li></ul><h2 id="blogs" tabindex="-1">Blogs <a class="header-anchor" href="#blogs" aria-hidden="true">#</a></h2><h3 id="power-platform-microsoft-5" tabindex="-1">Power Platform (Microsoft) <a class="header-anchor" href="#power-platform-microsoft-5" aria-hidden="true">#</a></h3><ul><li><a href="https://zenity.io/blog" target="_blank" rel="noreferrer">Zenity</a> - Low Code security and governance.</li><li><a href="https://www.darkreading.com/edge-articles/addressing-the-low-code-security-elephant-in-the-room" target="_blank" rel="noreferrer">Addressing the Low Code Security Elephant in the Room</a> - The shared responsibility model for Low Code applications.</li><li><a href="https://blog.powp.co/" target="_blank" rel="noreferrer">PowPco</a> - Single-stop community for everything Power Platform Community related.</li></ul><h3 id="workato-4" tabindex="-1">Workato <a class="header-anchor" href="#workato-4" aria-hidden="true">#</a></h3><ul><li><a href="https://www.workato.com/the-connector/" target="_blank" rel="noreferrer">The Connector</a> - Workato blog on Business Automation.</li></ul><h2 id="other-lists" tabindex="-1">Other Lists <a class="header-anchor" href="#other-lists" aria-hidden="true">#</a></h2><h3 id="power-platform-microsoft-6" tabindex="-1">Power Platform (Microsoft) <a class="header-anchor" href="#power-platform-microsoft-6" aria-hidden="true">#</a></h3><ul><li><a href="https://github.com/Power-Maverick/awesome-power-platform" target="_blank" rel="noreferrer">Awesome Microsoft Power Platform</a> - A collection of awesome things regarding the Power Platform ecosystem.</li><li><a href="https://github.com/valentin-vogel/awesome-nocode-lowcode" target="_blank" rel="noreferrer">Awesome No Code Low Code</a> - A collection of awesome No Code and Low Code resources.</li></ul>',58),l=[i];function n(s,c,m,p,f,h){return r(),o("div",null,l)}const w=e(a,[["render",n]]);export{u as __pageData,w as default};
